import React from 'react';
import ReactDOM from 'react-dom';
import Header from '../../parts/header/Header.js'
import Footer from '../../parts/footer/Footer.js'
import GalleryIndex from './content/GalleryIndex.js'
import Navbar from '../../parts/navbar/Navbar.js'
import './MyGallery.css'
import Gallery from 'react-grid-gallery';
import { PopupWidget } from "react-calendly";
import {IMAGES} from './content/GalleryInner'
import {Animated} from "react-animated-css";

class MyGallery extends React.Component {
  render() {
    return (
      <div id='home'>
        <Navbar />
        <div className="headerGallery animated bounce infinite divBackImg1 row">
          // <Animated animationIn="swing" animationOut="fadeOut" isVisible={true}>
            <div className='inner'>

                <span> גלריית תמונות </span>

            </div>
          // </Animated>
        </div>
        <PopupWidget
           color="#00a2ff"
           text=" קבעי תור עכשיו"
           textColor="#ffffff"
           url="https://calendly.com/afraa-kablan/echg"
        />
        <div className='gall'>
          <Gallery images={IMAGES}/>
        </div>
        <Footer />
      </div>
    );
  }
}

export default MyGallery;
